import React, { useState } from "react";

const CandidateProfile = () => {
  const [profile, setProfile] = useState({
    name: "Gaurav Kumar",
    email: "gaurav@example.com",
    phone: "+91-9876543210",
    skills: ["JavaScript", "React", "Node.js"],
    about:
      "Enthusiastic full-stack developer with a passion for building scalable web applications.",
  });

  const [isEditing, setIsEditing] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile((prev) => ({ ...prev, [name]: value }));
  };

  const handleSkillsChange = (e) => {
    const skillArray = e.target.value.split(",").map((s) => s.trim());
    setProfile((prev) => ({ ...prev, skills: skillArray }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsEditing(false);
    console.log("Updated Profile:", profile);
    // later connect to backend via API
  };

  return (
    <div className="max-w-3xl mx-auto p-6 bg-white rounded shadow mt-10">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold text-gray-800">Candidate Profile</h2>
        <button
          onClick={() => setIsEditing(!isEditing)}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          {isEditing ? "Cancel" : "Edit"}
        </button>
      </div>

      {isEditing ? (
        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label className="block font-medium text-gray-600">Name:</label>
            <input
              type="text"
              name="name"
              value={profile.name}
              onChange={handleChange}
              className="w-full px-4 py-2 border rounded mt-1"
              required
            />
          </div>
          <div>
            <label className="block font-medium text-gray-600">Email:</label>
            <input
              type="email"
              name="email"
              value={profile.email}
              onChange={handleChange}
              className="w-full px-4 py-2 border rounded mt-1"
              required
            />
          </div>
          <div>
            <label className="block font-medium text-gray-600">Phone:</label>
            <input
              type="text"
              name="phone"
              value={profile.phone}
              onChange={handleChange}
              className="w-full px-4 py-2 border rounded mt-1"
              required
            />
          </div>
          <div>
            <label className="block font-medium text-gray-600">
              Skills (comma separated):
            </label>
            <input
              type="text"
              value={profile.skills.join(", ")}
              onChange={handleSkillsChange}
              className="w-full px-4 py-2 border rounded mt-1"
            />
          </div>
          <div>
            <label className="block font-medium text-gray-600">About:</label>
            <textarea
              name="about"
              value={profile.about}
              onChange={handleChange}
              rows="4"
              className="w-full px-4 py-2 border rounded mt-1"
            />
          </div>
          <button
            type="submit"
            className="bg-green-600 text-white px-6 py-2 rounded hover:bg-green-700"
          >
            Save Changes
          </button>
        </form>
      ) : (
        <div className="space-y-4">
          <div>
            <label className="block text-gray-600 font-semibold">Full Name:</label>
            <p className="text-gray-800">{profile.name}</p>
          </div>
          <div>
            <label className="block text-gray-600 font-semibold">Email:</label>
            <p className="text-gray-800">{profile.email}</p>
          </div>
          <div>
            <label className="block text-gray-600 font-semibold">Phone:</label>
            <p className="text-gray-800">{profile.phone}</p>
          </div>
          <div>
            <label className="block text-gray-600 font-semibold">Skills:</label>
            <div className="flex flex-wrap gap-2 mt-1">
              {profile.skills.map((skill, index) => (
                <span
                  key={index}
                  className="bg-blue-100 text-blue-800 text-sm px-2 py-1 rounded-full"
                >
                  {skill}
                </span>
              ))}
            </div>
          </div>
          <div>
            <label className="block text-gray-600 font-semibold">About Me:</label>
            <p className="text-gray-800">{profile.about}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default CandidateProfile;
